import React, { useEffect, useState } from "react";
import userApi from "../../../api/api-user-setting";

export default function Setting() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    userAll();
  }, []);

  const userAll = async () => {
    await userApi.findOneUser(1).then((data) => {
      setUsers(data);
    });
  };
  console.info(users);
  return (
    <div className="ml-5">
      {/* Logo */}
      <div className="mt-6">
        <span className="border border-slate-500 p-2 rounded-xl"></span>
      </div>
      <div>
        <p className="mt-6">Home / Setting</p>
      </div>
    </div>
  );
}
